-- Table structure for user_info
-- ----------------------------
DROP TABLE IF EXISTS `user_info`;
CREATE TABLE `user_info` (
  `user_id` varchar(40) NOT NULL COMMENT '用户id',
  `role_id` varchar(40) DEFAULT NULL COMMENT '角色id',
  `category_id` varchar(40) DEFAULT NULL COMMENT '所属机构id',
  `dept_id` varchar(40) DEFAULT NULL COMMENT '用户所属部门id',
  `user_name` varchar(100) DEFAULT NULL COMMENT '用户名称',
  `birthday` date DEFAULT NULL COMMENT '用户出生日期',
  `gender` varchar(40) DEFAULT NULL COMMENT '用户性别',
  `address` varchar(100) DEFAULT NULL COMMENT '用户地址',
  `phone` varchar(40) DEFAULT NULL COMMENT '用户联系方式',
  `email` varchar(40) DEFAULT NULL COMMENT '用户电子邮箱',
  `create_time` date DEFAULT NULL COMMENT '创建时间',
  `modify_time` date DEFAULT NULL COMMENT '修改时间',
  `user_state` varchar(40) DEFAULT NULL COMMENT '用户状态（0.启用 1.禁用）',
  `user_category` varchar(40) DEFAULT NULL COMMENT '用户分类（0.普通用户-无机构分类 1.归属机构）',
  `user_descr` text,
  `login_account` varchar(100) DEFAULT NULL COMMENT '登录账号',
  `login_password` varchar(100) DEFAULT NULL COMMENT '登录密码',
  `login_image` varchar(100) DEFAULT NULL COMMENT '登录头像路径设置',
  `del_tag` varchar(40) DEFAULT NULL COMMENT '删除标识（0.未删除 1.已删除）',
  PRIMARY KEY (`user_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

